"use strict";webui.define("webui-page-requires",{constructor:t=>{Object.keys(t.dataset).forEach((key=>{let subTo=t.dataset[key],setter=webui.toCamel(`set-${subTo}`);t[setter]=value=>{value||webui.navigateTo("/")}}))}});